define({"topics" : [{"title":"Creating a data profile","shortdesc":"\n                     <p class=\"shortdesc\">The report profiles defined in <span class=\"ph\">TestArchitect Client</span> can be used     as data profiles for Dashboard panels, and vice versa.\n                     </p>\n                  ","id":"Dashboard_create_data_profile","href":"TA_Help\/Topics\/Dashboard_create_data_profile.html","menu": {"hasChildren":false,},"tocID":"Dashboard_create_data_profile-d46e28302","topics":[]},{"title":"Deleting a data profile","shortdesc":"\n                     <p class=\"shortdesc\">Deleting a data profile removes that data profile from the repository, <span class=\"ph\">Dashboard</span>, and <span class=\"ph\">TestArchitect</span> reports.\n                     </p>\n                  ","id":"Dashboard_delete_data_profile","href":"TA_Help\/Topics\/Dashboard_delete_data_profile.html","menu": {"hasChildren":false,},"tocID":"Dashboard_delete_data_profile-d46e28318","topics":[]},{"title":"Editing a data profile","shortdesc":"\n                     <p class=\"shortdesc\">Modifying the properties of a data profile.</p>\n                  ","id":"Dashboard_edit_data_profile","href":"TA_Help\/Topics\/Dashboard_edit_data_profile.html","menu": {"hasChildren":false,},"tocID":"Dashboard_edit_data_profile-d46e28335","topics":[]},{"title":"Saving a data profile","shortdesc":"\n                     <p class=\"shortdesc\">A non-guest user can save any existing data profile regardless of the owner, and can     then take ownership of the newly\n                        saved  profile.\n                     </p>\n                  ","id":"Dashboard_save_data_profile","href":"TA_Help\/Topics\/Dashboard_save_data_profile.html","menu": {"hasChildren":false,},"tocID":"Dashboard_save_data_profile-d46e28346","topics":[]}]});